import React from "react";
import Variants from "./Variants";

const Vendor = ({ vendor }) => {
  return (
    <div className="vendor-detail">
      {vendor.variants.map((vendor) => (
        <React.Fragment key={vendor.id}>
          <Variants vendor={vendor} />
        </React.Fragment>
      ))}
    </div>
  );
};

export default Vendor;
